package ra.dev.model.dto;import java.io.Serializable;public class CartDTO implements Serializable {    private Integer cartId;    private Integer discount;    private String note;    private Integer quantity;    private Integer product;    public Integer getCartId() {        return this.cartId;    }    public void setCartId(Integer cartId) {        this.cartId = cartId;    }    public Integer getDiscount() {        return this.discount;    }    public void setDiscount(Integer discount) {        this.discount = discount;    }    public String getNote() {        return this.note;    }    public void setNote(String note) {        this.note = note;    }    public Integer getQuantity() {        return this.quantity;    }    public void setQuantity(Integer quantity) {        this.quantity = quantity;    }    public Integer getProduct() {        return this.product;    }    public void setProduct(Integer product) {        this.product = product;    }}